import { StyleSheet} from 'react-native';
import {ImageBackground} from 'react-native';

const imgbkg = "./img/logomarca.png";

const css = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#D0ECF6',
    alignItems: 'center',
    justifyContent: 'center',
  },

login_msg:{
  fontSize: 22,
  color: "#fff",
  marginTop: 10,
  marginBottom: 15
},

login_form:{
  width:"80%",
},

login_input:{
  backgroundColor: "#fff",
  fontSize: 19,
  padding: 7,
  marginBottom: 15
},

login_button:{
  padding: 12,
  backgroundColor:"#A5DEF5",
  alignSelf: "center",
  borderRadius: 5
},

login_buttonText:{
  fontWeight: "bold",
  fontSize: 22,
  color:"#cyan"
},


});

export {css};
